import './App.css'
import FormSearchBug from "./Components/FormSearchBug/FormSearchBug";
import { BrowserRouter, Route, Routes } from "react-router-dom";

const App = () => {
  const [inputValue, setInputValue] = useState('')
  const handleSubmit = (e) => {
    e.preventDefault()

    const formData = new FormData(e.target)
    const data = Object.fromEntries(formData)


    console.log("*** handleSubmit", data)

  }

  const handleInputChange = (e) => {
    console.log("*** handle input change", e.target.value)
    setInputValue(e.target.value)
  }

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<FormSearchBug inputValue={inputValue} handleSubmit={handleSubmit} handleInputChange={handleInputChange} setInputValue={setInputValue}/>}/>
        <Route path="/teste" element={<><h1>Teste Page</h1></>} />

      </Routes>


    </BrowserRouter>
  );
};

export default App;




